webpackJsonp([83050626864197],{1306:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/google-analytics-unveiled/index.md absPath of file >>> MarkdownRemark",html:'<p>Google have released the google analytics on their google code service – which basically means they’re opening up the API &#x26; stuff like that in a similar way to the way google maps works, and allows you to configure and customise it.</p>\n<p><a href="http://analytics.blogspot.com/2008/09/decoding-google-analytics.html">http://analytics.blogspot.com/2008/09/decoding-google-analytics.html</a></p>\n<p>I wonder what <a href="http://www.aboutnico.be/">Nicolas Lierman</a> (the guy who spent months reverse engineering the API to build an AIR Application version of Google Analytics) feels about them just making it open... (Gutted, I bet)</p>\n<p><strong>Also:</strong> Ever wondered what the difference is between Google Analytics and Urchin software? <a href="http://www.google.com/support/googleanalytics/bin/answer.py?hl=en&#x26;answer=55536">http://www.google.com/support/googleanalytics/bin/answer.py?hl=en&#x26;answer=55536</a></p>',frontmatter:{title:"Google Analytics — Unveiled.",date:"September 12, 2008",tags:["apis","google-analytics","google-code"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/google-chrome-is-kinda-awesome/",tags:["javascript","chrome","google","webkit"],title:"Google Chrome is kinda awesome...",date:"2008-09-10T13:58:27.000Z",description:null,image:null}},next:{frontmatter:{path:"/blog/actionscript-2-xml-cdata-returns-undefined-or-htmltext-doesnt-work/",tags:["actionscript","flash","cdata","quirks","xml"],title:"ActionScript 2 - XML CDATA returns undefined, or htmlText doesn't work!",date:"2008-09-17T07:40:13.000Z",description:null,image:null}}}}}});
